import React from 'react';
import { Link } from 'react-router-dom';

const navCont = {
    background: 'linear-gradient(180deg, rgba(0,0,0,0.5965346534653465) 37%, rgba(95,113,140,0) 99%)',
    position: 'fixed',
    top: 0,
    width: '100%',
    transition: 'top 0.3s',
    zIndex: '1000',
}

const nav = {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    height: '6vw',
    maxHeight: '50px',
    minHeight: '40px',  
    padding: '3px 0 0 0',
}

const navLogoCont = {
    maxHeight: 'inherit', 
    height: 'inherit', 
    display: 'flex', 
    alignItems: 'center'
}

const navLogo = {
    margin: '0 0 .3vw 0vw',
    height: '4.35vw',
    maxHeight: '40px',
    minHeight: '23px',
}

// ------------
function HamburgerNav() {

    return (
        <header style={ navCont }>
            <nav style={ nav }>
                <Link style={ navLogoCont } to='/'>
                    <img src="/images/navLogo.png" alt="CBSI" style={ navLogo } />
                </Link>
                <div></div>

            </nav>
        </header>
    );
}

export default HamburgerNav;
